import React from 'react';
import Card from './Card';

const currentWeather = {
  day: 'Monday',
  wheatherImage: '',
  dayTemperature: '',
  nightTemperature: ''
}

export default class App extends React.Component{
  render(){
    return (
      <div className='row flex-column align-items-center'>
        <Card currentWeather={currentWeather} />
      </div>
    )
  }
}
